import React from 'react';
import { AppRouterLink } from '../../../UI/AppRouterLink'


export const HeaderMainNav = () => {
  const navLinksData = [
    { name: 'Акции', href: '/stock' }
  ]


  return (
    <div className="container">
      <div className="row">
        <nav>
          { navLinksData.map(({ name, href, Icon }) => (
            <AppRouterLink href={ href }>{ name }</AppRouterLink>
          )) }
        </nav>
      </div>
    </div>
  )
}
